import { useState } from 'react';
import './ScheduleItem.css'

function ScheduleItem({isOpen, closeModal, onSave})  {
    const [inputValue, setInputValue] = useState('');

    const [start, setStart] = useState("");
    const [end, setEnd] = useState("");
    const [startday, setStartday] = useState("");
    const [starthour, setStarthour] = useState("");
    const [startmin, setStartmin] = useState("");
    const [endday, setEndday] = useState("");
    const [endhour, setEndhour] = useState("");
    const [endmin, setEndmin] = useState("");

    const handleChangeStart = (event) => setStart(event.target.value);
    const handleChangeEnd = (event) => setEnd(event.target.value);

    const handleChangeStartday = (event) => setStartday(event.target.value);
    const handleChangeStarthour = (event) => setStarthour(event.target.value);
    const handleChangeStartmin = (event) => setStartmin(event.target.value);

    const handleChangeEndday = (event) => setEndday(event.target.value);
    const handleChangeEndhour = (event) => setEndhour(event.target.value);
    const handleChangeEndmin = (event) => setEndmin(event.target.value);

    const handleSave = (event) => {
        event.preventDefault(); // 폼 전송 막기


        onSave({
            start: start,
            end: end,

            startday: startday,
            starthour: starthour,
            startmin: startmin,

            endday: endday,
            endhour: endhour,
            endmin: endmin
          });
      };

    return (<div  style={{ display: isOpen ? "block" : "none" }}>
        <div className='modal_background' onClick={closeModal}></div>
        <div className="modal-title">
        </div>
        <div className="Smodal_wrap">
            <div className="modal_textset">
                <form>
                    <div className="Smodal-title align-center">일정 추가</div>
                    <div className='content-set'>
                        <div className='input-column-location align-center'>
                            <div className='input-column-text'>출발지</div>
                            <div className='input-column-content align-center'> 
                                <input className='input-design' name='start' value={start} onChange={handleChangeStart}/>
                                <div className='input-result-text'>간사이 국제 공항</div>
                            </div>
                        </div>
                        <div className='input-column-location align-center'>
                            <div className='input-column-text'>도착지</div>
                            <div className='input-column-content align-center'> 
                                <input className='input-design' name='end' value={end} onChange={handleChangeEnd}/>
                                <div className='input-result-text'>오사카 국제 공항</div>
                            </div>
                        </div>
                        <div className='input-column align-center'>
                            <div className='input-column-text'>시간</div>
                            <div className='input-column-content'>

                                <div className='input-column-content-starttime align-center'>
                                    <div className='input-column-content-starttime-title'>시작 시간</div>

                                    <div className='input-column-content-starttime-content align-center'>
                                        <div className='input-column-content-starttime-date align-center'>
                                            <input className='input-column-content-starttime-date-text' name='SDate' type='date' onChange={handleChangeStartday}/>
                                        </div>
                                        <div className='input-column-content-starttime-time align-center'>
                                            <input className='input-column-content-starttime-time-text' name='SHour' onChange={handleChangeStarthour}/>
                                            <input className='input-column-content-starttime-time-text' name='STime' onChange={handleChangeStartmin}/>
                                        </div>
                                    </div>
                                </div>

                                <div className='input-column-content-starttime align-center'>
                                    <div className='input-column-content-starttime-title'>종료 시간</div>

                                    <div className='input-column-content-starttime-content align-center'>
                                        <div className='input-column-content-starttime-date align-center'>
                                            <input className='input-column-content-starttime-date-text' name='SDate' type='date' onChange={handleChangeEndday}/>
                                        </div>
                                        <div className='input-column-content-starttime-time align-center'>
                                            <input className='input-column-content-starttime-time-text' name='SHour' onChange={handleChangeEndhour}/>
                                            <input className='input-column-content-starttime-time-text' name='STime' onChange={handleChangeEndmin}/>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                    <button type="submit" onClick={handleSave}>제출</button>
                </form>
            </div>      
        </div>

    </div>)
}

export default ScheduleItem;
